import React from 'react';
import { View, Text, StyleSheet, ScrollView } from 'react-native';

export default function Home() {
    return (
        <View style={style.container}>
            <View style={style.header}> 
               <Image>
                   soucer={require('../../assets/fseletro-banner.png')}
               </Image>

            </View>
        </View>
    );
}
